<script>
$ = jQuery
$.fn.randomize = function(childEl) {
	return $(this).each(function() {
		var $this = $(this), elems = $this.children(childEl)
		elems.sort(function() {
			return Math.round(Math.random()) - 0.5
		})
		$this.detach(childEl)
		for(var i = 0; i < elems.length; i++) {
			$this.append(elems[i])
		}
	})
}
$.fn.style = $.fn.css
var log = console.log.bind(console)
var tile1, tile2
$(function() {
	// $("div").slice(138).remove()
	$("div").slice(49).remove()
	$("div").each(function() {$(this).after($(this).clone())})
	$("body").randomize("div")
	// $("div").sortable({})
	// $("div").draggable({snap: true, grid: [74, 74]})
	$("div").disableSelection()
	$(document).on("click", "div", function() {
		if ($(this).hasClass("done")) {
			return
		}
		if (!tile1) {
			tile1 = $(this)
			tile1.toggleClass($(this).attr("title")).toggleClass("blank")
			log(tile1.attr("title"))
			return
		}
		if (tile1 && !tile2) {
			tile2 = $(this)
			tile2.toggleClass($(this).attr("title")).toggleClass("blank")
			log(tile2.attr("title"))
			return
		}
		if (tile1 && tile2) {
			log(tile1.attr("title"), tile2.attr("title"), tile1.attr("title") !== tile2.attr("title"))
			if (tile1.attr("title") !== tile2.attr("title")) {
				tile1.removeClass(tile1.attr("title"))
				tile2.removeClass(tile2.attr("title"))
			}
			else {
				tile1.addClass("done")
				tile2.addClass("done")				
			}
			tile1 = undefined
			tile2 = undefined
			$(this).click()
		}

		// $(this).toggleClass($(this).attr("title")).toggleClass("blank")



		// if ($(this).hasClass("blank")) {
		//	$(this).removeClass("blank").addClass($(this).attr("title"))
		// }
		// else {
		//	$(this).removeClass($(this).attr("title")).addClass("blank")
		// }
	})
})
</script>
